/* Create routers for the client side

  -  The first one will be for create room button
  -  Second one for join button
  -  3rd one for Login button
*/

import React from "react";
import Corps from "/components/Corps"
import Chat from "./components/chatroom";

const Routes = {
  "/": () => <Corps />,
  "/chatroom": () => <Chat />,
};
export default Routes;
